import "./app.css";
import axios from "axios";
import { useEffect, useState } from "react";

function App() {
  // const [first, setfirst] = useState(second);

  useEffect(() => {
    const config = {
      method: "get",
      url: "https://www.googleapis.com/youtube/v3/videos?part=snippet&chart=mostPopular&maxResults=26&key=AIzaSyBW5lajHHzU0DJjkuEcY3miO7Ztj-uavDI",
      headers: {},
    };
    axios(config).then(console.log);
  }, []);

  return <div>start react practice</div>;
}

export default App;
